INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アヤネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", 2, 2, 10046, 401, 0.0, 102301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アヤネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", 1, 2, 10046, 402, 2.21, 102301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アヤネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", 2, 2, 10046, 403, 0.0, 102301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アサヒ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 2, 1, 10046, 701, 1.99, 192201);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アサヒ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", 1, 2, 10046, 702, 2.21, 192201);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アサヒ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 2, 1, 10046, 703, 3.33, 192201);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("部員３", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", 2, 2, 10046, 801, 0.0, 192301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("部員３", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", 1, 2, 10046, 802, 2.68, 192301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("部員３", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 2, 2, 10046, 803, 0.0, 192301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24010, "やった！", "2020/07/31 12:00:00", 1, 1, 10046, 501, 0.0, 192501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24011, "勝ったよ！", "2020/07/31 12:00:00", 1, 1, 10046, 502, 0.0, 192501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24012, "いい調子！", "2020/07/31 12:00:00", 1, 1, 10046, 503, 0.0, 192501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", 6, 2, 10046, 111, 5.33, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", 1, 2, 10046, 112, 6.85, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", 1, 2, 10046, 113, 3.0, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ダイチ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", 1, 2, 10046, 611, 6.11, 192401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ダイチ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", 1, 2, 10046, 612, 6.75, 192401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ダイチ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", 2, 2, 10046, 613, 0.0, 192401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ハツネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", 2, 1, 10046, 211, 4.52, 113401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ハツネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", 2, 1, 10046, 212, 3.89, 113401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ハツネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", 1, 2, 10046, 213, 13.49, 113401);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("カヤ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", 1, 2, 10046, 311, 3.17, 106501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("カヤ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", 1, 2, 10046, 312, 4.42, 106501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("カヤ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", 6, 1, 10046, 313, 2.89, 106501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アヤネ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", 4, 3, 10046, 421, 3.71, 102301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("アサヒ", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", 2, 1, 10046, 721, 5.1, 192201);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("部員３", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", 1, 3, 10046, 821, 4.34, 192301);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("", 24, 0.0, "2030/12/17 14:59:59", 0.0, 24028, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", 1, 1, 10046, 521, 0.0, 192501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, -360.0, "2030/12/17 14:59:59", 0.0, 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", 1, 2, 10046, 101, 5.62, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, -360.0, "2030/12/17 14:59:59", 0.0, 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", 1, 2, 10046, 102, 9.58, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, -360.0, "2030/12/17 14:59:59", 0.0, 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", 2, 2, 10046, 103, 0.0, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, -360.0, "2030/12/17 14:59:59", 0.0, 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", 2, 1, 10046, 104, 9.13, 113501);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ミサト", 24, -360.0, "2030/12/17 14:59:59", 0.0, 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", 1, 2, 10046, 105, 8.27, 113501);
